import React, { useEffect, useState } from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';


function NavBar() {
    
  return (
    <nav id="nav" class="bottom-shadow navbar navbar-expand-lg bg-body-tertiary position-sticky light bg-white">
            <i className="fas fa-search"></i>

            <div class="container">
              <h1 id="logo" class="navbar-brand mid-bold light">Where in the world?</h1>
              <div class="mode d-flex align-items-center gap-1">
                <button type="button" class="btn light" id="mode-btn">Dark Mode</button>
            </div>
            </div>
    </nav>
  );
}

export default NavBar;
